  {
    display: "Movies",
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Movies",
    subItems: [],
  },
  {
    display: "People",
    icon: <i className="bx bx-chevron-down"></i>,
    section: "People",
    subItems: [
    ],
  },
  {
    display: "Planets",
    icon: <i className="bx bx-chevron-down"></i>,
    section: "Planets",
    subItems: [
      {
        display:'Planets',
        to:'/planets'
      }
    ],
  },
];

